import React from "react";
import { Link } from "react-router-dom";
import "../App.css";

const HomePage = () => {
  return (
    <div className="homepage">
      {/* Hero Section */}
      <div className="hero-section minimal">
        <h1>Your Dream Venue Awaits</h1>
        <p>Plan your events effortlessly with our platform.</p>
        <Link to="/signup" className="hero-btn">Book Now</Link>
      </div>

      {/* Features Section */}
      <section className="features-section">
        <div className="features">
          <div className="feature-card">
            <i className="fas fa-hotel"></i>
            <h3>Wide Range of Venues</h3>
            <p>Explore venues across various locations.</p>
          </div>
          <div className="feature-card">
            <i className="fas fa-wallet"></i>
            <h3>Transparent Pricing</h3>
            <p>No hidden charges or fees.</p>
          </div>
          <div className="feature-card">
            <i className="fas fa-headset"></i>
            <h3>24/7 Support</h3>
            <p>Round-the-clock assistance.</p>
          </div>
        </div>
      </section>

      <footer>
        <p>Â© 2024 Mahal Booking Platform</p>
      </footer>
    </div>
  );
};

export default HomePage;
